    value: This responds to your letter of 2/3/05. (1) The negative ending cash balance
      was a result of our omitting nonfederal transfers-in on the pre-election report.
      We have amended that report to show the receipts; the negative balance is corrected.
      (2) We have provided memo text on the payment for Fundraising videos. (3) We
      have provided memo text on the payment for Banners & Signs. (4) The H6 payments
      for Campus Coordinator
  - name: AMENDED CD
    number: '5'
    value: ' Political Consulting Services'
  - value: ' and Precinct Coordinator were to individuals who are NOT employees. These
      individuals are self-employed. (5) The H6 payment for Robo Phone Calls were
      for automated calls with entirely generic content'
  - value: ' encouraging the hearer to vote or to vote Democratic. The message did
      not promote'
  - value: ' support'
  - value: ' attack'
  - value: ' or oppose'
  - value: ' or even refer to'
  - value: ' any candidate. (6) The H6 payments for Mail ballot mailer'
  - value: ' Volunteer Phone Bank'
  - value: ' Volunteer Phone Banks'
  - value: ' and Volunteer Phone Bank Supervisor were for allocable Federal Election
      Activity-GOTV. These were not for exempt activities; we used volunteers to make
      GOTV calls that had no candidate content. (7) We have clarified the purposes
      of the H6 disbursements you questioned. (8) The L-A receipt from Lloyd Doggett
