  input: TEXT,F3XA,,"This responds to your letter of 2/3/05. (1) The negative ending
    cash balance was a result of our omitting nonfederal transfers-in on the pre-election
    report. We have amended that report to show the receipts; the negative balance
    is corrected. (2) We have provided memo text on the payment for Fundraising videos.
    (3) We have provided memo text on the payment for Banners & Signs. (4) The H6
    payments for Campus Coordinator, Political Consulting Services, and Precinct Coordinator
    were to individuals who are NOT employees. These individuals are self-employed.
    (5) The H6 payment for Robo Phone Calls were for automated calls with entirely
    generic content, encouraging the hearer to vote or to vote Democratic. The message
    did not promote, support, attack, or oppose, or even refer to, any candidate.
    (6) The H6 payments for Mail ballot mailer, Volunteer Phone Bank, Volunteer Phone
    Banks, and Volunteer Phone Bank Supervisor were for allocable Federal Election
    Activity-GOTV. These were not for exempt activities; we used volunteers to make
    GOTV calls that had no candidate content. (7) We have clarified the purposes of
    the H6 disbursements you questioned. (8) The L-A receipt from Lloyd Doggett for
    Congress was a mistake. It should have gone into our federal account. We are removing
    it to our non-Levin nonfederal account and are sending you a copy by mail."
